import { Button, Typography, Input } from "antd";
import React from "react";
import { Link } from "react-router-dom";
import Center from "../../../theme/layout/Center";
import Stack from "../../../theme/layout/Stack";
import YourAccount from "../../components/YourAccount";
import { pathLogin } from "../../paths";
import "./Luxury.less";

const { Title, Text } = Typography;
const { Search } = Input;

function Luxury(): JSX.Element {
  return (
    <Center tag="main" className="Luxury">
      <Stack className="MainStack">
        <Typography>
          <Title>Luxury</Title>
        </Typography>
        <Typography>
          <Text>(cosmos1ym5m5dw7ptt7jkf8f0k3k3o30889ju</Text>
        </Typography>
        <Search placeholder="Name" enterButton />
        {/* RESULT COMPONENTS */}
        <Stack tag="nav">
          <Button disabled type="primary">
            Free
          </Button>
          <Link to={pathLogin}>
            <Button type="primary">Luxury</Button>
          </Link>
          <Button disabled type="primary">
            Tokens
          </Button>
        </Stack>
        <YourAccount tag="footer" />
      </Stack>
    </Center>
  );
}

export default Luxury;
